import Post from "./Post";
import PostCreate from "./PostCreate";
import Stack from '@mui/material/Stack';


const Feed = ({ handlePost, userID, getFeed, posts }) => {
   const {friendPosts, myPosts} = posts;
   const totalPosts = friendPosts?.concat(myPosts);
    return (
        <div className=" mt3 center">
            <Stack spacing={3} direction="column">
                <PostCreate handlePost={handlePost} />
                {totalPosts.map(post => <Post post={post} userId={userID} />)}
                <button onClick={() => getFeed()}>refresh</button>
            </Stack>
        </div>
    );
};

export default Feed;
